import { useHistory } from "react-router-dom";

const CardForm = ({
    cardFrontHandler,
    cardBackHandler,
    submitHandler,
    card = {}
    }) => {

        const history = useHistory();

    return(
        <form>
          <div>
            <label>Question</label>
                <input
                    type="text"
                    onChange={cardFrontHandler}
                />
          </div>
          <div>
            <label>Answer</label>
                <input
                    type="text"
                    onChange={cardBackHandler}
                    defaultValue={card.back}
                />
            </div>
            <button type="button" onClick={() => history.go(-1)}>Back to Deck</button>
            <button type="submit" onClick={submitHandler}>Save</button>
        </form>
    )
}

export default CardForm;
